pragma solidity 0.6.12;

contract Exchange {
    address public admin;
    address public feeAccount;
    mapping (address => uint256) public feetake;
    mapping (address => uint256) public feedeposit;
    mapping (address => uint256) public feewithdraw;
    mapping (address => mapping (address => uint256)) public tokens;
