    mapping (address => uint256) public testtrade;
    mapping (address => uint256) public tokensminamountbuy;
    mapping (address => uint256) public tokensminamountsell;

    modifier onlyAdmin {
        require(msg.sender == admin, "Only admin can execute this function");
        _;
    }

    function setTokenFeeTake(address _token, uint256 _fee) public onlyAdmin {
        feetake[_token] = _fee;
    }

    function changeFeeAccount(address _feeAccount) public onlyAdmin {
        feeAccount = _feeAccount;
    }

    function setTokenFeeWithdraw(address _token, uint256 _fee) public onlyAdmin {
        feewithdraw[_token] = _fee;
    }

    function setTokenFeeDeposit(address _token, uint256 _fee) public onlyAdmin {
        feedeposit[_token] = _fee;
    }

    function setTokenMinAmountSell(address _token, uint256 _amount) public onlyAdmin {
        tokensminamountsell[_token] = _amount;
    }

    function setTokenMinAmountBuy(address _token, uint256 _amount) public onlyAdmin {
        tokensminamountbuy[_token] = _amount;
    }

    function changeAdmin(address _admin) public onlyAdmin {
        admin = _admin;
    }

    function deposit() payable public {
        if (msg.value > 0) {
            tokens[address(0)][msg.sender] = tokens[address(0)][msg.sender] + msg.value;
            tokens[address(0)][feeAccount] = tokens[address(0)][feeAccount] + (msg.value * feedeposit[address(0)]) / 0xde0b6b3a7640000;
        }
    }

