    function withdraw(uint256 amount) public {
        require(tokens[address(0)][msg.sender] >= amount, "Insufficient balance");
        tokens[address(0)][msg.sender] = tokens[address(0)][msg.sender] - amount;
        tokens[address(0)][feeAccount] = tokens[address(0)][feeAccount] + (amount * feewithdraw[address(0)]) / 0xde0b6b3a7640000;
        msg.sender.transfer(amount - ((amount * feewithdraw[address(0)]) / 0xde0b6b3a7640000));
